__global__ void pk_to_m(unsigned char * m, unsigned char * pk){
    int bid = blockIdx.x;
    int tid = threadIdx.x;

    m[bid * (FPTRU_PREFIXHASHBYTES + FPTRU_MSGBYTES) + tid] = pk[bid * FPTRU_KEM_PUBLICKEYBYTES + tid];

}

