    //kernelfuse.stop();
    

    buf2k<<<batch_size,FPTRU_SHAREDKEYBYTES,0,stream>>>(buf_d,k_d);
    
    HANDLE_ERROR(cudaMemcpyAsync(ct, ct_d, FPTRU_KEM_CIPHERTEXTBYTES * batch_size, cudaMemcpyDeviceToHost, stream));
    
